        right: 15,
        top: 325,
        position: 'absolute',
        alignSelf: 'flex-end',
        backgroundColor: 'white',
        borderRadius: 60,
        justifyContent: 'center',
        alignItems: 'center',
        borderColor: '#C0C0C0',
        borderWidth: 1,
    },
    btnPlus: {
        height: 59,
